                marginTop: '10px'
              }} />
            </form>
          </div>
        </div>
        <div className="moreInfo">

          <ul>
            <h3 className="title">Холбоо барих</h3>
            <li>pets124@gmail.com
              <br />
              Улаанбаатао хот
              <br />
              office : +12 34 995 0792</li>

          </ul>
        </div>
      </div>
      <div  style={{
          display: 'flex',

      }}>
              <p>© 2022 Амьтны дэлгүүр, Ч.Чинбат </p>
      </div>
    </>
  );
}

